import express from 'express';
import filmDAL from '../DAL/filmDAL';
import slug from 'slug';
import db from '../mysql/mysql';

var router = express.Router();

/* GET home page. */
router.get('/', (req, res) => {
    filmDAL.getFilms(req).then(data => {
        res.json(data);
    }).catch(err => {
        res.json(err);
    });
});

router.get('/GetFilterDropdownData', (req, res) => {
    var result = {};
    console.log(req);
    Promise.all([filmDAL.getFilmLength(req), filmDAL.getFilmTypes(req), filmDAL.getYearPublished(req), filmDAL.getCountries(req)])
        .then(data => {
            result['filmLength'] = data[0];
            result['filmTypes'] = data[1];
            result['yearPublished'] = data[2];
            result['countries'] = data[3];
            res.json(result);
        })
        .catch(err => { console.log(err) });
});

router.get('/GetFilmDetail', (req, res) => {
    filmDAL.getFilmDetail(req).then(data => {
        if (data.length > 0) {
            if (data[0].Slug == req.query.filmSlug) {
                res.json(data[0]);
            } else {
                var url = '/phim/' + data[0].Slug + '-' + data[0].Id;
                res.status(301).json({ redirectLink: url });
            }
        } else {
            res.json('not ok');
        }
    }).catch(err => {
        res.json(err);
    });
});

router.get('/db', (req, res, next) => {
    db.getConnection(function (err, connection) {
        if (err) {
            connection.release();
            res.send('connect fail');
        } else {
            connection.query('Select * from films', function (err, rows, fields) {
                connection.release();
                if (err) {
                    res.send('error in query');
                } else {
                    res.json(rows.length);
                }
            });
        }
    });
});

